import * as React from "react";

interface ButtonProps {
  icon: string;
  children: React.ReactNode;
  className?: string;
}

const Button: React.FC<ButtonProps> = ({ icon, children, className = "" }) => (
  <div className={`flex gap-2 justify-center px-3 py-2 rounded-xl border border-blue-500 border-solid ${className}`}>
    {icon && <img src={icon} alt="" className="shrink-0 my-auto w-4 aspect-square" />}
    <div>{children}</div>
  </div>
);

const buttons = [
  { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/b40f294a32618b7fdbcab022c02174b9a49f8f2bdf297de8fd13c99c4d9a0938?apiKey=e2acf27c88624070b50c81a74432dd81&", label: "Stop" },
  { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/3886d973a91f46f7c34c467c51933fa110f49c7ecb0ab28a2788c35ec0df4365?apiKey=e2acf27c88624070b50c81a74432dd81&", label: "Formatter" },
];

const shareButtons = [
  { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/62285cd5acea067cc3f2d1b7f1fd75bdcff1cb2927cec9867618ae54809248ee?apiKey=e2acf27c88624070b50c81a74432dd81&", label: "Share" },
  { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/f8f68ee9aaf30253c13fdb819aee3d62efc4d0837e4b9006e52a4559d9d94b82?apiKey=e2acf27c88624070b50c81a74432dd81&", label: "Collaborate" },
  { icon: "https://cdn.builder.io/api/v1/image/assets/TEMP/58eac2dd1945d551918836bfd96f8f3e18e6e7ea712d513767f28023c5b2b764?apiKey=e2acf27c88624070b50c81a74432dd81&", label: "Download" },
];

interface DropdownProps {
  label: string;
}

const Dropdown: React.FC<DropdownProps> = ({ label }) => (
  <div className="flex gap-2">
    <div className="my-auto font-bold text-black">{label}</div>
    <div className="flex flex-col justify-center text-white">
      <div className="flex gap-0.5 justify-center p-2 bg-blue-500 rounded-xl">
        <div>Actions</div>
        <img src={`http://b.io/ext_${label === "Language" ? "7" : "8"}-`} alt="" className="shrink-0 my-auto w-4 aspect-square" />
      </div>
    </div>
  </div>
);

function MyComponent() {
  return (
    <div className="flex flex-col justify-center p-12 bg-white max-md:px-5">
      <h1 className="text-2xl font-bold leading-7 text-black max-md:max-w-full">Online code editor</h1>
      <div className="flex gap-5 justify-between mt-6 w-full text-base leading-5 whitespace-nowrap max-md:flex-wrap max-md:max-w-full">
        <div className="flex gap-1.5 justify-between font-bold text-blue-500 max-md:flex-wrap">
          <div className="flex gap-2.5">
            <Button icon="https://cdn.builder.io/api/v1/image/assets/TEMP/b0db45f1fcb9e7d3d64b8ed68b82f991929c11c1de9f45f31e8393801a2be740?apiKey=e2acf27c88624070b50c81a74432dd81&" className="text-white bg-indigo-400">
              Run
            </Button>
            {buttons.map(({ icon, label }) => (
              <Button key={label} icon={icon}>
                {label}
              </Button>
            ))}
          </div>
          <div className="shrink-0 w-px border border-solid bg-zinc-300 border-zinc-300 h-[35px]" />
          <div className="flex gap-2.5">
            {shareButtons.map(({ icon, label }) => (
              <Button key={label} icon={icon}>
                {label}
              </Button>
            ))}
          </div>
        </div>
        <div className="flex gap-5 justify-between">
          <Dropdown label="Language" />
          <Dropdown label="Theme" />
        </div>
      </div>
      <div className="mt-10 max-md:max-w-full">
        <div className="flex gap-5 max-md:flex-col max-md:gap-0">
          <div className="flex flex-col w-3/5 max-md:ml-0 max-md:w-full">
            <div className="shrink-0 self-stretch mx-auto max-w-full bg-zinc-300 h-[798px] w-[782px] max-md:mt-10" />
          </div>
          <div className="flex flex-col ml-5 w-2/5 max-md:ml-0 max-md:w-full">
            <section className="flex flex-col grow self-stretch pb-6 text-2xl font-bold leading-7 text-black max-md:mt-10 max-md:max-w-full">
              <h2 className="max-md:max-w-full">Output</h2>
              <div className="shrink-0 mt-4 bg-zinc-300 h-[283px] max-md:max-w-full" />
              <h2 className="mt-5 max-md:max-w-full">Custom input</h2>
              <div className="shrink-0 mt-4 bg-zinc-300 h-[234px] max-md:max-w-full" />
              <h3 className="self-start mt-5">Status</h3>
              <h3 className="self-start mt-5">Memory</h3>
              <h3 className="self-start mt-5">Time</h3>
            </section>
          </div>
        </div>
      </div>
    </div>
  );
}

export default MyComponent;
